        await TestBed.configureTestingModule({
            declarations: [ComponentNameComponent]
        })
            .compileComponents();
    });
    beforeEach(() => {
        fixture = TestBed.createComponent(ComponentNameComponent);
        component = fixture.componentInstance;
        fixture.detectChanges();
    });
